import React from "react";
import "./styles/App.css";
import { Container, Paper, Box, Typography, Grid, TextField } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  root: {
    width: "100vw",
    height: "100vh",
    backgroundColor: theme.palette.grey[300],
    paddingTop: theme.spacing(5),
  },
}));

function App() {
  const classes = useStyles();
  return (
    <Container className={classes.root}>
      <Paper component={Box}  p={4}>
        <Grid Container spacing={3}>
          <Grid item md={3}>
            <TextField
            label="Nome"
            placeholder="Nome"
            variant="outlined"
            fullWidth />  
          </Grid>
          <Grid item md={3}>
            <TextField
            label="PontoIncial"
            placeholder="PontoIncial"
            variant="outlined"
            fullWidth />  
          </Grid>
          <Grid item md={3}>
            <TextField
            label="PontoFinal"
            placeholder="PontoFinal"
            variant="outlined"
            fullWidth />  
          </Grid>
          <Grid item md={4}>
            <TextField
            label="Tamanho"
            placeholder="Nome"
            variant="outlined"
            fullWidth />  
          </Grid>
        </Grid>
      </Paper>
    </Container>
  );
}

export default App;
